-- Prerequisites Trigger --

DROP TABLE IF EXISTS TEST_Prerequisites

CREATE TABLE TEST_Prerequisites
( PrerequisiteID int NOT NULL,
  PrereqFor varchar(30) NOT NULL,
  PrereqIs varchar(30) NOT NULL,
  CONSTRAINT PK_TESTPrerequisites PRIMARY KEY CLUSTERED 
    (
	    PrerequisiteID ASC
    )
)

GO

CREATE TRIGGER PrerequisitesForeignKeyConvertor ON TEST_Prerequisites
	INSTEAD OF INSERT 
AS
BEGIN
	SET NOCOUNT ON;

	DECLARE @PrerequisiteID INT;
	DECLARE @PreFor VARCHAR(30);
	DECLARE @PreIs VARCHAR(30);

	DECLARE @PrereqFor int;
	DECLARE @PrereqIs int;

	SELECT @PrerequisiteID = INSERTED.PrerequisiteID
	FROM INSERTED

	SELECT @PreFor = INSERTED.PrereqFor
	FROM INSERTED

	SELECT @PreIs = INSERTED.PrereqIs
	FROM INSERTED

	SELECT @PrereqIs = CourseID
	FROM Courses
		INNER JOIN Subjects
			ON Courses.SubjectID = Subjects.SubjectID
	WHERE SubjectAbbreviation + ' ' + CourseNumber = @PreIs

	SELECT @PrereqFor = CourseID
	FROM Courses
		INNER JOIN Subjects
			ON Courses.SubjectID = Subjects.SubjectID
	WHERE SubjectAbbreviation + ' ' + CourseNumber = @PreFor

	SET IDENTITY_INSERT [Prerequisites] ON
	VALUES (@PrerequisiteID, @PrereqIs, @PrereqFor)
	SET IDENTITY_INSERT [Prerequisites] OFF
END

GO


GO